import React, { useState } from 'react';

const LandingPage = ({ onSubmit }) => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    industry: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Call the onSubmit prop with the form data
    onSubmit(formData);
  };

  const { firstName, lastName, email, industry } = formData;

  return (
    <div className="bg-indigo-500 min-h-screen flex flex-col">
      <div>
        <div id="navbar" className="navbar flex justify-between p-9 text-black text-center py-4">
          <div className="logo">
            <span className="text-xl font-bold text-black">Richard</span>
          </div>
          <div>
            <nav>
              <a href="#" className="text-gray-800 hover:text-gray-600 mx-2">
                Facebook
              </a>
              <a href="#" className="text-gray-800 hover:text-gray-600 mx-2">
                Twitter
              </a>
              <a href="#" className="text-gray-800 hover:text-gray-600 mx-2">
                Email
              </a>
              <a href="#" className="text-gray-800 hover:text-gray-600 mx-2">
                Instagram
              </a>
            </nav>
          </div>
          <hr className="my-4 border-black" />
        </div>
        <div>
          <img src="" alt="creative person" />
        </div>

      </div>




      <footer className='bg-black text-white p-4'>
        <small>Terms & Support</small>
      </footer>
    </div>
  );
};

export default LandingPage;
